import React from "react";
import { Link } from "react-router-dom";
import style from "./styles.module.scss";
import Moment from "react-moment";

const ContactRead = (contact) => {
  return (
    <div className={style["contact"]}>
      <div className={style["contact__body"]}>
        <Link
          className={style["contact__body__title"]}
          to={`/contacts/${contact.id}`}
        >
          {contact.name}
        </Link>
        <div className={style["contact__body__email"]}>{contact.email}</div>
        <div className={style["contact__body__info"]}>
          <Moment date={contact.sentAt} format="DD MMM, YYYY" />
        </div>
        <span>{contact.messenger}</span>

        <div className={style["contact__body__read"]}>
          <Link to={`/contacts/${contact.id}`}>Read...</Link>
        </div>
      </div>
    </div>
  );
};

export default ContactRead;
